             "getendpointfordirection:withcompletion",
             "gets the farthest points to which the gimbal will rotate during manual controller input.  use `djigimbalparampitchupendpoint`, `djigimbalparampitchdownendpoint`, `djigimbalparamyawleftendpoint`  and `djigimbalparamyawrightendpoint` with `capabilities` to check if the gimbal supports  this feature.  @param direction the endpoint direction. @param endpoint the endpoint value. @param error error retrieving the value. @param completion the completion block that receives execution result.",
             "setmotorenabled:withcompletion",
             "turns on and off the gimbal motors. `no` means the gimbal power remains on, however the motors will not work.  @param enabled `yes` to enable the motor. @param completion the completion block that receives execution result.",
             "getmotorenabledwithcompletion",
             "gets if the gimbal motors are enabled to work or not.  @param enabled the enabled value. @param error error retrieving the value. @param completion the completion block that receives execution result.",
             "toggleselfiewithcompletion",
             "resets gimbal position to selfie setup. if the gimbal yaw is not at 180 degrees, then calling this method will rotate the gimbal yaw to 180 degrees (effectively pointing the camera to the person holding the gimbal). if the gimbal yaw is at 180 degrees, then the gimbal will rotate in yaw to 0 degrees.  @param completion the completion block that receives execution result.",
             "setstickcontrollermode:withcompletion",
