             "getsecondaryvideooutputenabledwithcompletion",
             "gets whether secondary video output on remote controller is enabled. the remote controller outputs video to the  mobile device by default, but a secondary video can be routed to its hdmi or sdi port.  use `setsecondaryvideooutputenabled:withcompletion` to enable or disable,  and `setsecondaryvideooutputport:withcompletion` to choose the port.  @param enabled the enabled value. @param error error retrieving the value. @param completion completion block.",
