             "setsecondaryvideodisplaymode:withcompletion",
             "sets the secondary video output picture in picture (pip) display mode. the air link module can connect to both  an fpv camera (through the hdmi and av ports) and a camera mounted on the hd gimbal (through the gimbal port).  the output video can then be a combination of the two video sources. either a single video source can be  displayed, or one can be displayed within the other (as a picture in picture, or pip). if the mode is set  incorrectly,  then no output video will be displayed.  @param videodisplaymode picture in picture (pip) display mode. @param completion completion block.",
