             "setwhitebalance:withcompletion",
             "sets the camera's white balance. when the white balance is a preset value (values  except `djicamerawhitebalancepresetcustom`), the colortemperature</code>  argument does not take effect. when the white balance is `djicamerawhitebalancepresetcustom`,  the `colortemperature` value is used instead.  @param whitebalance white balance value to be set. @param completion completion block.  see also: `djicamerawhitebalancepreset` to view all possible white balance setting options for the camera.",
             "getwhitebalancewithcompletion",
