             "getlensinformationwithcompletion",
             "gets details of the installed lens. supported only by the x5, x5r  and x5s cameras. this is available only when  `isinterchangeablelenssupported` returns `yes`.  @param info the info string value. @param error error retrieving the value. @param completion completion block to receive the result.",
             "isdigitalzoomsupported",
