             "getdigitalzoomfactorwithcompletion",
             "gets current digital zoom. it is supported by osmo with x3 camera, phantom 4 camera,  z3 camera, mavic pro camera and z30 camera. note z30 cannot set the digital zoom scale,  but will use digital zoom when using `startcontinuousopticalzoomindirection:withspeed:withcompletion` and the optical zoom has reached its limit.  @param factor the scale value. @param error error retrieving the value. @param completion completion block to receive the result.",
             "isopticalzoomsupported",
