             "getopticalzoomspecwithcompletion",
             "gets the specification of the zoom lens. it is only supported by x5, x5r and x5s camera with lens olympus m.zuiko ed 14-42mm f/3.5-5.6 ez, z3 camera and z30 camera.  @param spec the value of the `djicameraopticalzoomspec` struct. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setopticalzoomfocallength:withcompletion",
