             "getopticalzoomfactorwithcompletion",
             "gets current optical zoom factor with range [1,30]. only supported by z30 camera. the z30 zoom factor can be changed with `setopticalzoomfocallength:withcompletion` and `startcontinuousopticalzoomindirection:withspeed:withcompletion`. the zoom factor is then calculated and given through this method.  @param factor the zoom factor value. @param error error retrieving the value. @param completion completion block to receive the result.",
