             "getthermaldigitalzoomfactorwithcompletion",
             "gets current digital zoom. supported only by thermal imaging cameras.  @param factor the value of the `djicamerathermaldigitalzoomfactor` enum. @param error error retrieving the value. @param completion completion block to receive the result.",
             "getthermalprofilewithcompletion",
             "gets the thermal imaging camera profile. the profile includes information about resolution, frame rate and focal  length. supported only by thermal imaging cameras.  @param profile the value of the `djicamerathermalprofile` struct. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setthermalspotmeteringtargetpoint:withcompletion",
             "sets the spot metering target point which then changes the camera:didupdatetemperaturedata: delegate call to  return. this method requires a relative point that is proportional  to the dimension of the camera video dimension, the x, and y values must all be between 0 and 1.0. supported only  by zenmuse xt containing advanced radiometry capabilities.  @param targetpoint the desired target point. @param completion completion block that receives the setter execution result.",
             "getthermalspotmeteringtargetpointwithcompletion",
             "gets the spot metering target point if one is set, if not then returns cgpointzero. supported only by zenmuse  xt containing advanced radiometry capabilities.  @param targetpoint the cgpoint struct. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setthermalmeteringarea:withcompletion",
             "set the metering area for a rectangle inside the thermal image scene, which allows the camera to transmit  aggregate temperature computations via the `camera:didupdateareatemperatureaggregations`  delegate method. see `djicamerathermalareatemperatureaggregations`  for the statistical values that are available. this method requires a relative rect that is proportional to  the rect of the thermal scene, the x, y, width, and height values must all be between 0 and 1.0. supported  only by zenmuse xt containing advanced radiometry capabilities.  @param area the desired thermal metering area. @param completion completion block that receives the setter execution result.",
             "getthermalmeteringareawithcompletion",
             "get a rect representing the currently set metering area for the thermal scene. supported only by zenmuse xt  containing advanced radiometry capabilities.  @param area the cgrect struct. @param error error retrieving the value. @param completion completion block to receive the result.",
