             "getthermalcustomexternalscenesettingsprofilewithcompletion",
             "get the currently set custom user profile. this profile represents user-set external scene parameters for the  thermal scene. supported only by thermal imaging cameras.  @param profile the value of the `djicamerathermalcustomexternalscenesettingsprofile` enum. @param error error retrieving the value. @param completion completion block to receive the result.",
             "setthermalatmospherictemperature:withcompletion",
