             "isvirtualstickcontrolmodeavailable",
             "indicates whether the virtual stick control interface can be used. virtual stick mode  is only availablle when all of the follow requirements are met:   - virtual stick mode is enabled.   - no waypoint, hotpoint, or follow-me mission is running.   - `djiflightorientationmode` is set to `djiflightorientationmodeaircraftheading`   - terrain-follow is disabled if the aircraft supports this feature.   - tripod mode is disabled if the aircraft supports this feature.  @return bool `yes` if virtual stick mode is available.",
