                   "/Components/RemoteController/DJIRemoteController.html",
                   "",
                   "This class represents the remote controller of the aircraft. It provides methods to change the settings of the  physical remote controller. For some products (e.g. Inspire 1 and Matric 100), the class provides methods to  manager the slave/master mode of the remote controllers. A remote controller is a device that can have a GPS,  battery, radio, buttons, sticks, wheels, and output ports for video. The mobile device is connected to the  remote controller, which is always sending out information about what everything is doing. The normal remote controller is called the master. A slave wirelessly connects to the master remote controller at 5 GHz, and  the aircraft can also download information to the slave. The slave can send gimbal control commands to the  master. This configuration allows one person to fly the aircraft while another person controls the gimbal. This object is available from the `DJIAircraft` subclass off `DJIBaseProduct`.",
