                   "#DJIOcuSyncLink_getChannelNumberValidRange_inline",
                   "Gets the valid range of Channel Numbers. The OcuSync link operates on a 10 MHz or 20 MHz channel between  2400.5 MHz and 2482.5 MHz. The channel can be centered at 1 MHz steps within the band. Therefore for a 10 MHz  bandwidth, the OcuSync channel can be centered at 2405.5 MHz, 2406.5 MHz and every 1 MHz to 2477.5 MHz. For a  20 MHz bandwidth, channel center can be at 2410.5 MHz to 2472.5 MHz in 1 MHz steps. The channel location within  the band is specified using the Channel Number. Channel Number is defned as the integer of 0.5 MHz less than the  channel center frequency. E.g. Channel Number 2406 represents the 10 MHz channel centered at 2406.5 MHz (this is  only for the 10 MHz bandwidth as 20 MHz bandwidth channels start at 2410.5 MHz). Channel Number 2450 represents the channel centered at 2450.5 MHz (of any bandwidth). This method should be used to confirm the Channel Number  to be set with `setChannelNumber:withCompletion` is valid.  @param range The valid range of Channel Numbers. @param error Error retrieving the value. @param completion Completion block to receive the result.",
